Diagnosis
. Male palp (
Figs 18a–b
) with small blunt tipped TA. MA with short proximal pointed projection, directed prolaterally and with similar but broader distal projection. Embolus simple and relatively narrow, with pointed tip. Palpal patella with one dorsal spine, palpal tibia with one slender dorsal spine. Female epigynum (
Figs 18c–d
) with lateral teeth located ventral to sclerotized gonopore openings. Tarsal organ capsulate, situated distally of trichobothria.
